    <style>
        #icon-container {
            height: 30px;
            text-align: center;
        }

        #icon-container #reset {
            padding: 5px;
            font-size: 18px;
            cursor: pointer;
            display: inline-block;
            background-color: gray;
            width: 18px;
            height: 18px;
            width: 48px;

    }

    #reset-alert {
        border: 2px solid #ccc;
        border-radius: 5px;
        display: none;
    }

    @media only screen and (min-width: 768px)
    .reveal-modal.small {
        margin-left: -20%;
        width: 40%;
    }

    @media only screen and (min-width: 768px)
    .reveal-modal {
        padding: 1.875em;
        top: 6.25em;
    }

    .reveal-modal {
        visibility: hidden;
        display: none;
        position: absolute;
        left: 50%;
        z-index: 99;
        height: auto;
        margin-left: -40%;
        width: 80%;
        background-color: #fff;
        padding: 1.25em;
        border: solid 1px #666;
        -webkit-box-shadow: 0 0 10px rgba(0,0,0,0.4);
        box-shadow: 0 0 10px rgba(0,0,0,0.4);
        top: 50px;
    }

    .reveal-modal {
        margin-left: -40% !important;
        width: 80% !important;
    }
    </style>
    <script>
        function resetAlert() {
                let dialog = document.getElementById('reset-alert');
                dialog.style.display = 'block';
                dialog.style.visibility = 'visible';
        }
    </script>
